import React, { useState } from 'react';
import './App.css';
import myPhoto from './imgs/me.jpg';
import project1 from './imgs/photo.jpg';
import project2 from './imgs/photo.jpg';
import project3 from './imgs/photo.jpg';

function App() {
  const [message, setMessage] = useState('');
  const [projectInfo, setProjectInfo] = useState(null);

  const handleSendMessage = () => {
    alert(`Message sent successfully! ${message}`);
    setMessage(''); // Reset the message state to an empty string
  };

  const handleProjectClick = (projectName) => {
    switch (projectName) {
      case 'Project 1':
        setProjectInfo({
          title: 'Kick Streaming',
          description: 'A dynamic and engaging platform dedicated to live streaming and video content. It offers a seamless experience for both content creators and viewers, featuring high-quality video streaming, interactive chat, and a wide array of entertainment options.',
          image: project1,
        });
        break;
      case 'Project 2':
        setProjectInfo({
          title: 'iPhone',
          description: 'A line of smartphones designed and marketed by Apple Inc. It combines a mobile phone, iPod, and internet communication device in a single handheld device.',
          image: project2,
        });
        break;
      case 'Project 3':
        setProjectInfo({
          title: 'Globe Icon',
          description: 'A simple globe or earth icon to symbolize global reach or creativity.',
          image: project3,
        });
        break;
      default:
        setProjectInfo(null);
    }
  };

  return (
    <div className="App">
      <header>
        <h1>My Portfolio</h1>
      </header>
      <div className="grid-container">
        <div className="info-container">
          <div className="about-me" style={{
            backgroundColor: '#ADD8E6', // light blue background color
            border: '1px solid #ADD8E6', // light blue border color
            borderRadius: '10px', // rounded corners
            padding: '10px', // padding inside the box
            boxShadow: '0px 0px 10px rgba(0,0,0,0.2)' // shadow effect
          }}>
            <h2>About Me</h2>
            <img src={myPhoto} alt="Jan R. Reodica" style={{ width: '150px', borderRadius: '50%' }} />
            <p>Hi! I'm a 3rd-year Computer Science student at De La Salle Lipa with a passion for tech and coding. I'm eager to take on new challenges and improve my skills through projects, group work, and internships. 
            Outside of coding, I enjoy exploring tech trends, playing video games, and hanging out with friends. Excited to connect and grow in the world of CS!</p>
          </div>
          <div className="projects" style={{
            backgroundColor: '#ADD8E6', // light blue background color
            border: '1px solid #ADD8E6', // light blue border color
            borderRadius: '10px', // rounded corners
            padding: '10px', // padding inside the box
            boxShadow: '0px 0px 10px rgba(0,0,0,0.2)' // shadow effect
          }}>
            <h2>Projects</h2>
            <ul style={{ listStyleType: 'none', padding: 0, margin: 0 }}>
              <li>
                <h3>Project 1</h3>

                <img src={project1} alt="Project 1" style={{ width: '200px' }} />
                <br />
                <button 
                  style={{
                    backgroundColor: '#007bff', // blue background color
                    color: 'white', 
                    padding: '10px 20px', 
                    border: 'none', 
                    borderRadius: '5px', 
                    cursor: 'pointer',
                    fontWeight: 'bold' // added bold font weight
                  }} 
                  onClick={() => handleProjectClick('Project 1')}>
                  View Project
                </button>
              </li>
              <li>
                <h3>Project 2</h3>
                <img src={project2} alt="Project 2" style={{ width: '200px' }} />
                <br />
                <button 
                  style={{
                    backgroundColor: '#ff69b4', // pink background color
                    color: 'white', 
                    padding: '10px 20px', 
                    border: 'none', 
                    borderRadius: '5px', 
                    cursor: 'pointer',
                    fontWeight: 'bold' // added bold font weight
                  }} 
                  onClick={() => handleProjectClick('Project 2')}>
                  View Project
                </button>
              </li>
              <li>
                <h3>Project 3</h3>
                <p>A simple globe or earth icon to symbolize global reach or creativity.</p>
                <img src={project3} alt="Project 3 " style={{ width: '200px' }} />
                <br />
                <button 
                  style={{
                    backgroundColor: '#8bc34a', // green background color
                    color: 'white', 
                    padding: '10px 20px', 
                    border: 'none', 
                    borderRadius: '5px', 
                    cursor: 'pointer',
                    fontWeight: 'bold' // added bold font weight
                  }} 
                  onClick={() => handleProjectClick('Project 3')}>
                  View Project
                </button>
              </li>
            </ul>
          </div>
          {projectInfo && (
            <div className="project-info" style={{
              backgroundColor: '#ADD8E6', 
              border: '1px solid #ADD8E6', 
              borderRadius: '10px', 
              padding: '10px', 
              boxShadow: '0px 0px 10px rgba(0,0,0,0.2)' 
            }}>
              <h2>{projectInfo.title}</h2>
              <p>{projectInfo.description}</p>
              <img src={projectInfo.image} alt={projectInfo.title} style={{ width: '200px' }} />
            </div>
          )}
          <div className="contact-me" style={{
            backgroundColor: '#ADD8E6', 
            border: '1px solid #ADD8E6', 
            borderRadius: '10px', 
            padding: '10px', 
            boxShadow: '0px 0px 10px rgba(0,0,0,0.2)' 
          }}>
            <h2>Contact Me</h2>
            <textarea
              value={message}
              onChange={(e) => setMessage(e.target.value)}
              placeholder="Leave a message..."
              rows={5}
              cols={30}
              style={{ padding: '10px', fontSize: '16px' }}
            />
            <br /><br />
            <button style={{ backgroundColor: '#4CAF50', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '5px', cursor: 'pointer' }} onClick={handleSendMessage}>
              Send Message
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
